// **************Sound_Init*********************
// Initialize digital outputs and SysTick timer
// Called once, with sound/interrupts initially off
// Input: none
// Output: none
void Sound_Init(void){
    DAC_Init();
    NVIC_ST_CTRL_R = 0;               // disable SysTick during setup
    NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000; // priority 1   31  29    
 
};


// **************Sound_Start*********************
// Start sound output, and set Systick interrupt period 
// Sound continues until Sound_Start called again, or Sound_Off is called
// This function returns right away and sound is produced using a periodic interrupt
// Input: interrupt period
//           Units of period to be determined by YOU
//           Maximum period to be determined by YOU
//           Minimum period to be determined by YOU
//         if period equals zero, disable sound output
// Output: none
void Sound_Start(uint32_t period){ //period will be in nano seconds (10^-9)
    NVIC_ST_RELOAD_R = period - 1;    //reload value
    NVIC_ST_CURRENT_R = 0;                    //clear current
    NVIC_ST_CTRL_R = 0x07; // enable SysTick with core clock and interrupts
}

// **************Sound_Off*********************
// stop outputing to DAC
// Output: none
void Sound_Off(void){
    NVIC_ST_CTRL_R = 0x0;
    DAC_Out(0);
}



